    "contracts/VerifyAirdrop.sol": {
      "content": "// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;

import "hardhat/console.sol";

import "@openzeppelin/contracts-upgradeable/security/ReentrancyGuardUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/PausableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/structs/EnumerableSetUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/interfaces/IERC20Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";

contract VerifyAirdrop is
    ReentrancyGuardUpgradeable,
    OwnableUpgradeable,
    PausableUpgradeable
{
    using EnumerableSetUpgradeable for EnumerableSetUpgradeable.AddressSet;

    event VerifyToken(address userAddress, address tokenPaymentAddresses, uint256 tokenPaymentAmount, uint256 amountTokenVerified, uint256 nonce);

    uint256 public minUSDTPaymentAmount;
    uint256 public minBNBPaymentAmount;
    address payable public feeRecipient;
    uint256 public startTime;
    uint256 public endTime;

    mapping(address => bool) public whitelistedExchanger;
    mapping(address => mapping(uint256 => bool)) public userUsedNonces;
    mapping(uint256 => address) public tokenPaymentAddresses;
    mapping(address => uint256) public amountTokenVerified;

    modifier onlyExchanger() {
        require(
            whitelistedExchanger[_msgSender()],
            "Not whitelisted as Exchanger"
        );
        _;
    }

    modifier minTokenPaymentAmount(uint256 tokenPaymentIndex) {
        if (tokenPaymentAddresses[tokenPaymentIndex] == address(0)) {
            require(
                msg.value >= minBNBPaymentAmount,
                "Balance native coin must be greater than minimum BNB payment amount"
            );
        } else {
            uint256 balance = IERC20Upgradeable(
                tokenPaymentAddresses[tokenPaymentIndex]
            ).balanceOf(_msgSender());
            require(
                balance >= minUSDTPaymentAmount,
                "Balance token ERC20 must be greater than minimum USDT payment amount"
            );
        }
        _;
    }

    receive() external payable {}

    fallback() external payable {}

    function initialize(address _feeRecipient,address _usdtAddress, uint256 _minBNBPaymentAmount, uint256 _minUSDTPaymentAmount, uint256 _startTime, uint256 _endTime) public initializer {
        __ReentrancyGuard_init_unchained();
        __Context_init_unchained();
        __Ownable_init_unchained();
        __Pausable_init_unchained();

        feeRecipient = payable(_feeRecipient);
        tokenPaymentAddresses[0] = address(0);
        tokenPaymentAddresses[1] = _usdtAddress;
        minBNBPaymentAmount = _minBNBPaymentAmount;
        minUSDTPaymentAmount = _minUSDTPaymentAmount;
        startTime = _startTime;
        endTime = _endTime;
    }

    //---------------------------ADMIN FUNCTIONS-------------------------------------
    function pause() external onlyOwner {
        _pause();
    }

    function unpause() external onlyOwner {
        _unpause();
    }

    function depositToken(
        address tokenAddress,
        uint256 amount
    ) external onlyOwner {
        executeFundsTransfer(tokenAddress, msg.sender, address(this), amount);
    }

    function setFeeRecipient(address recipient) external onlyOwner {
        require(
            recipient != address(0),
            "Recipient address cannot be address 0"
        );
        feeRecipient = payable(recipient);
    }

    function rescueStuckErc20(
        address _tokenAddress,
        address _to
    ) external onlyOwner {
        uint256 _amount = IERC20Upgradeable(_tokenAddress).balanceOf(
            address(this)
        );
        executeFundsTransfer(_tokenAddress, address(this), _to, _amount);
    }

    function setExchanger(
        address _exchanger,
        bool _whitelisted
    ) external onlyOwner {
        require(
            whitelistedExchanger[_exchanger] != _whitelisted,
            "Invalid value for _exchanger"
        );
        whitelistedExchanger[_exchanger] = _whitelisted;
    }

    function setTokenPaymentAddresses(uint256 tokenPaymentIndex, address tokenPaymentAddress) external onlyOwner {
        tokenPaymentAddresses[tokenPaymentIndex] = tokenPaymentAddress;
    }

    function setTimeVerifyToken(uint256 _startTime, uint256 _endTime) external onlyOwner { 
        startTime = _startTime;
        endTime = _endTime;
    }

    //---------------------------PUBLIC FUNCTIONS--------------------------------

    function verifyToken(
        uint256 amountToken,
        uint256 tokenPaymentIndex,
        uint256 tokenPaymentAmount,
        uint256 nonce,
        bytes memory serverSig
    ) external payable nonReentrant whenNotPaused minTokenPaymentAmount(tokenPaymentIndex) {
        address userAddress = _msgSender();
        require(!userUsedNonces[userAddress][nonce], "Nonce already used");
        require(
            verifySignature(amountToken, tokenPaymentIndex, tokenPaymentAmount, nonce, serverSig),
            "Not valid signature from server"
        );
        require(block.timestamp >= startTime, "Verify token not yet started");
        require(block.timestamp <= endTime, "Verify token already ended");

        userUsedNonces[userAddress][nonce] = true;
        amountTokenVerified[userAddress] += amountToken;

        executeFundsTransfer(tokenPaymentAddresses[tokenPaymentIndex], userAddress, feeRecipient, tokenPaymentAmount);

        emit VerifyToken(userAddress, tokenPaymentAddresses[tokenPaymentIndex], tokenPaymentAmount, amountToken, nonce);
    }

    ///---------------------------INTERNAL FUINCTIONS------------------------------------
    /**
     * @dev Execute all token / native coin transfers associated with an order match (fees and from => to transfer)
     */
    function executeFundsTransfer(
        address paymentToken,
        address from,
        address to,
        uint256 amount
    ) internal virtual returns (uint256) {
        /* Only payable in the special case of unwrapped Native coin. */
        if (paymentToken != address(0)) {
            // If buy with bnb -> need msg.value
            if (from != address(0)) {
                require(msg.value == 0, "No need to transfer native coin");
            }
        }

        require(amount > 0, "Price must be greater than 0");

        if (paymentToken != address(0)) {
            if (from == address(this)) {
                uint256 balance = IERC20Upgradeable(paymentToken).balanceOf(
                    from
                );
                require(balance >= amount, "Not enough coin");
                bool sent = IERC20Upgradeable(paymentToken).transfer(
                    to,
                    amount
                );
                require(sent, "Failed to transfer token");
            } else {
                transferTokens(paymentToken, from, to, amount);
            }
        } else {
            require(msg.value >= amount, "Not enough coint");

            if (to != address(this)) {
                require(msg.value >= amount, "Not enough coin");
                payable(to).transfer(amount);
            }
        }

        return amount;
    }

    function verifySignature(
        uint256 amountToken,
        uint256 tokenPaymentIndex,
        uint256 tokenPaymentAmount,
        uint256 nonce,
        bytes memory serverSig
    ) public view returns (bool) {
        address userAddress = _msgSender();
        bytes32 signedMessage = prefixed(
            keccak256(abi.encodePacked(userAddress, amountToken,tokenPaymentIndex, tokenPaymentAmount, nonce))
        );

        return whitelistedExchanger[recoverSigner(signedMessage, serverSig)];
    }

    /**
     * @dev Transfer tokens
     * @param token Token to transfer
     * @param from Address to charge fees
     * @param to Address to receive fees
     * @param amount Amount of protocol tokens to charge
     */
    function transferTokens(
        address token,
        address from,
        address to,
        uint256 amount
    ) internal virtual {
        if (amount > 0) {
            bool sent = IERC20Upgradeable(token).transferFrom(from, to, amount);
            require(sent, "Failed to transfer token");
        }
    }

    function prefixed(bytes32 hash) internal pure returns (bytes32) {
        return
            keccak256(
                abi.encodePacked("\x19Ethereum Signed Message:\n32", hash)
            );
    }

    function recoverSigner(
        bytes32 message,
        bytes memory sig
    ) public pure returns (address) {
        uint8 v;
        bytes32 r;
        bytes32 s;
        (v, r, s) = splitSignature(sig);
        return ecrecover(message, v, r, s);
    }

    function splitSignature(
        bytes memory sig
    ) public pure returns (uint8, bytes32, bytes32) {
        require(sig.length == 65);

        bytes32 r;
        bytes32 s;
        uint8 v;

        assembly {
            // first 32 bytes, after the length prefix
            r := mload(add(sig, 32))
            // second 32 bytes
            s := mload(add(sig, 64))
            // final byte (first byte of the next 32 bytes)
            v := byte(0, mload(add(sig, 96)))
        }

        return (v, r, s);
    }
}
"
